/**
 * Generate secure password hash from plain text
 * @param string $password Plain text password
 * @return string Hashed password
 */
function generatePasswordHash($password) {
    return password_hash($password, PASSWORD_DEFAULT);
}

/**
 * Generate unique username from first name
 */
function generateUniqueUsername($firstName, &$usedUsernames) {
    $baseUsername = strtoupper(trim($firstName));
    $username = $baseUsername;
    $counter = 1;
    
    while (in_array($username, $usedUsernames)) {
        $username = $baseUsername . $counter;
        $counter++;
    }
    
    $usedUsernames[] = $username;
    return $username;
}

// Initialize
$usedUsernames = [];
$insertedCount = 0;
$errors = [];

echo "========================================\n";
echo "BARANGAY 498 PASSWORD HASH GENERATOR\n";
echo "========================================\n\n";

// Begin transaction
$conn->begin_transaction();

try {
    foreach ($residents as $index => $resident) {
        $firstName = $resident[0];
        $username = generateUniqueUsername($firstName, $usedUsernames);
        
        // Default password is "barangay498" + first name
        $defaultPassword = 'barangay498' . strtolower($firstName);
        $hashedPassword = generatePasswordHash($defaultPassword);
        
        // Insert into usercreds table
        $stmt = $conn->prepare("
            INSERT INTO usercreds 
            (username, password, full_name, address, date_of_birth, place_of_birth, 
             sex, civil_status, occupation, citizenship, relation_to_household, 
             account_type, status) 
            VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, 'resident', 'active')
        ");
        
        $stmt->bind_param("sssssssssss", 
            $username,
            $hashedPassword,
            $resident[1], // full_name
            $resident[2], // address
            $resident[3], // date_of_birth
            $resident[4], // place_of_birth
            $resident[5], // sex
            $resident[6], // civil_status
            $resident[7], // occupation
            $resident[8], // citizenship
            $resident[9]  // relation_to_household
        );
        
        if ($stmt->execute()) {
            $userId = $conn->insert_id;
            
            // Insert into userprofile498 table
            $stmtProfile = $conn->prepare("
                INSERT INTO userprofile498 
                (user_id, first_name, full_name, address, date_of_birth, place_of_birth, 
                 sex, civil_status, occupation, citizenship, relation_to_household) 
                VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?)
            ");
            
            $stmtProfile->bind_param("issssssssss",
                $userId,
                $firstName,
                $resident[1],
                $resident[2],
                $resident[3],
                $resident[4],
                $resident[5],
                $resident[6],
                $resident[7],
                $resident[8],
                $resident[9]
            );
            
            if ($stmtProfile->execute()) {
                $insertedCount++;
                echo " Created: $username (Password: $defaultPassword)\n";
            } else {
                throw new Exception("Profile insert failed for $username");
            }
            
            $stmtProfile->close();
        } else {
            throw new Exception("User insert failed for $username: " . $stmt->error);
        }
        
        $stmt->close();
    }
    
    // Commit transaction
    $conn->commit();
    
    echo "\n========================================\n";
    echo "SUCCESS: $insertedCount users created!\n";
    echo "========================================\n\n";
    
    echo "DEFAULT PASSWORD FORMAT:\n";
    echo "barangay498[firstname in lowercase]\n";
    echo "Example: barangay498felicidad\n\n";
    
    echo " SECURITY NOTE:\n";
    echo "Users should change their password immediately after first login.\n";
    echo "Delete this script after use!\n";
    
} catch (Exception $e) {
    $conn->rollback();
    echo "\n ERROR: " . $e->getMessage() . "\n";
    echo "Transaction rolled back.\n";
}

